import React from 'react';
import './About.css';

function About() {
  return (
    <div className="aboutSection">
      <h2>About Us</h2>
      <p>Welcome to our website! We are thrilled to have you here. Our team is dedicated to providing you with the best experience possible. Whether you're here to browse our gallery, learn more about our services, or just exploring, we're glad you're here. Our mission is to deliver excellence in everything we do, and we strive to make every visit to our site a pleasant one. Thank you for stopping by, and we hope you find what you're looking for!</p>
    </div>
  );
}

export default About;
